
create table pedidos
(
	id_pedido int unsigned auto_increment not null primary key,
	id_usuario char(10) not null,
	fecha_hora date,
	coste_total float(4,2)/*Verificar argumentos del float*/
);

create table desayunos_pedidos
(
	id_pedido int not null,
	id_desayuno char(4) not null,
	cantidad int,
	primary key (id_pedido, id_desayuno)
);

create table desayunos
(
	id_desayuno char(4) not null primary key,
	nombre char(20) not null,
	coste float(4,2)
);


DROP TABLE IF EXISTS `user_info`;

CREATE TABLE `user_info` (
  `id_usuario` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` char(30) DEFAULT NULL,
  `apellido1` char(30) DEFAULT NULL,
  `apellido2` char(30) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `password` char(8) NOT NULL,
  `sexo` char(1) DEFAULT NULL,
  `telefono1` int(9) DEFAULT NULL,
  `telefono2` int(9) DEFAULT NULL,
  `correo_electronico` char(30) DEFAULT NULL,
  `contratado` char(2) DEFAULT NULL,
  PRIMARY KEY (`id_usuario`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=latin1;



